import { ref, onMounted } from 'vue';
import axios from 'axios';
export default {
  name: 'Home',
  setup() {
    const profile = ref({
      availability: '',
      title: '',
      subtitle: '',
      buttons: []
    });
    const featuredProjects = ref([]);
    const fetchData = async () => {
      try {
        const [profileRes, projectsRes] = await Promise.all([axios.get('/api/profile.php'), axios.get('/api/projects.php?filter=featured')]);
        if (profileRes.data) {
          profile.value = profileRes.data;
        }
        if (projectsRes.data && projectsRes.data.projects) {
          featuredProjects.value = projectsRes.data.projects;
        }
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };
    onMounted(() => {
      fetchData();
    });
    return {
      profile,
      featuredProjects
    };
  }
};
